import { useState } from "react";
import axios from "axios";



function getBackend(func){
  axios.get("http://localhost:5000/",{crossdomain:true}).then((res)=>{
    func(res.data.name);
  })
}

function App() {
  const [text, setText] = useState("");

  return (
    <div >
      <h1>{text}</h1>
      <button onClick={getBackend.bind(this,setText)}>click</button>
    </div>
  );
}

export default App;
